// Ensure that all our calls to console.debug don't cause errors.
if (!global.console.debug) {
	global.console.debug = () => {}
}

/**
 * Goshawkdb client.
 */
module.exports = class Goshawk {
	/**
	 * Connects to the websocket port of a goshawkdb server.
	 * See the [goshawkdb documentation](https://goshawkdb.io/documentation.html) for more information.
	 *
	 * @param {string} url the url of the websocket endpoint. e.g. wss://localhost:9999/ws
	 * @param {*} connectionOptions in node.js, the connection options are used to make the connection.
	 * 				They are for the WS module and are defined [here](https://github.com/websockets/ws/blob/master/doc/ws.md).
	 * 				The options should include `key`, `cert` and if you don't want it to check
	 * 				the server certificates, `{rejectUnauthorized: false}`.
	 * @return {Promise<GosConnection, Error>} A promise that resolves with a connection or rejects with an error.
	 */
	static connect(url, connectionOptions) {
		return new GosConnection(url).connect(connectionOptions)
	}
}

const msgpack = require('../lib/msgpack.min')
const WebSocket = require('ws')

/**
 * The websocket and Msgpack connection.
 * @private
 */
class MsgpackConnection {
	constructor(url, connectionLabel = "") {
		this.url = url
		// connectionLabel is purely used for logging.
		this.connectionLabel = connectionLabel
		this.websocket = null
		this.options = {
			codec: msgpack.createCodec({binarraybuffer: true})
		}
		// all the callbacks!
		this.onOpen = null
		this.onEnd = null
		this.onMessage = null
		this.onClose = null
		this.onError = null
	}

	connect(onMessage, onEnd, onOpen, connectionOptions) {
		this.onMessage = onMessage
		// onEnd triggers onError or onClose.
		this.onEnd = onEnd
		this.onOpen = onOpen
		const websocket = this.websocket = new WebSocket(this.url, undefined, connectionOptions)
		websocket.binaryType = 'arraybuffer'
		websocket.onopen = (evt) => {
			console.debug(`Connection ${this.connectionLabel}: Connection Open`)
			if (this.onOpen) {
				this.onOpen(evt)
			}
		}
		websocket.onclose = (evt) => {
			console.debug(`Connection ${this.connectionLabel}: Connection Closed`, evt.code, evt.reason)
			if (this.onEnd) {
				this.onEnd(evt)
			}
			if (this.onClose) {
				this.onClose(evt)
			}
		}
		websocket.onerror = (evt) => {
			console.error(`Connection ${this.connectionLabel}: Connection Error`, evt.code, evt.reason)
			if (this.onEnd) {
				this.onEnd(evt)
			}
			if (this.onError) {
				this.onError(evt)
			}
		}
		websocket.onmessage = (messageEvent) => {
			const data = msgpack.decode(new Uint8Array(messageEvent.data));
			console.debug(`${this.connectionLabel} <`, data)

			if (this.onMessage) {
				this.onMessage(data)
			}
		}
	}

	send(message) {
		console.debug(`${this.connectionLabel} >`, message)
		this.websocket.send(msgpack.encode(message, this.options))
	}

	// sends a message, and returns a promise which resolves with the next message back from the server. This helps
	// make a request/response pattern easy.  It replaces onMessage and onEnd until it receives the message.
	request(message) {
		const oldHandler = this.onMessage
		const oldEndHandler = this.onEnd
		return new Promise((resolve, reject) => {
			this.onMessage = (msg) => {
				resolve(msg)
				this.onMessage = oldHandler
				this.onEnd = oldEndHandler
			}
			this.onEnd = (evt) => {
				this.onMessage = oldHandler
				this.onEnd = oldEndHandler
				reject(evt)
				if (oldEndHandler) {
					oldEndHandler(evt)
				}
			}
			this.send(message)
		})
	}

	close() {
		this.websocket.close()
	}
}

module.exports = MsgpackConnection

const {binaryToHex, toArrayBuffer} = require('./utils')
const {TransactionRetryNeeded, MutationNotAllowed} = require('./errors')
const Uint64 = require('./uint64')
const Ref = require('./ref')
const Goshawk = require('./goshawk')

function checkRefs(refs) {
	for (let i = 0; i < refs.length; ++i) {
		const ref = refs[i]
		if (ref instanceof Ref === false) {
			throw new TypeError(`Reference ${i} was not of reference type - was a ${ref.constructor.name} : ${ref.toString()}`)
		}
	}
}

/**
 * The top level object cache. It keeps objects value and refs stored against their id.
 * @private
 */
class ObjectCache {
	constructor() {
		this.objects = new Map()
	}

	get(id) {
		const hashable = binaryToHex(id)
		if (!this.objects.has(hashable)) {
			this.objects.set(hashable, new ObjectCacheEntry(id))
		}
		return this.objects.get(hashable)
	}

	remove(id) {
		const hashable = binaryToHex(id)
		if (!this.objects.has(hashable)) {
			throw new Error(`Unexpected remove of id ${hashable}`)
		}
		this.objects.delete(hashable)
	}

	getTemporaryView() {
		return new CopyCache(this)
	}
}

module.exports = ObjectCache

// An ObjectCacheEntry represents the clients knowledge about a GoshawkDB Object.
//  - It should always have an id.
//  - If it contains values known to have been in the database (either they have been sent in a cache update, or a
//    create/write that has been acknowledged.  The values version and data.value and data.refs will be set.
//	- data.refs and data.value will be set after a write or create.
class ObjectCacheEntry {
	constructor(id) {
		if (id instanceof Uint8Array == false) {
			throw new TypeError(`id must be a uint8, was ${String(id)}`)
		}
		this.id = id

		this.version = null
		this.data = {
			value: null,
			refs: null
		}

		// best effort attempt to restrict mutations in the data I return to the user.
		this.readOnlyData = Object.create({}, {
				value: {
					set: () => {
						throw new MutationNotAllowed("Cannot set value without a transaction.write call.")
					},
					get: () => {
						return this.data.value
					}
				},
				refs: {
					set: () => {
						throw new MutationNotAllowed("Cannot set references without a transaction.write call.")
					},
					get: () => {
						const srcRefs = this.data.refs
						if (global.Proxy) {
							return new Proxy(srcRefs, {
								set: () => {
									throw new MutationNotAllowed("Cannot change references without a transaction.write call.")
								}
							})
						} else {
							return srcRefs.slice()
						}
					}
				},
				version: {
					set: () => {
						throw new MutationNotAllowed("Cannot set references without a transaction.write call.")
					},
					get: () => {
						return this.version
					}
				}
			})

		// Record which actions have occurred on this object from the client.
		// These are only needed on objects within a transactions cache, not at the top level.
		//  - If something has been written or created, calling read on it has no effect (it is answered from cache).
		//  - If something has been created, calling write on it has no effect (the create is merely updated to the contents of the write).
		this.hasBeenWritten = false
		this.hasBeenRead = false
		this.hasBeenCreated = false
	}

	// Updates representing version, value and refs are they are in the remote database.  Can populate on an abort or a submit.
	update(version, value, refs) {
		value = toArrayBuffer(value)
		checkRefs(refs)
		this.data.value = value
		this.data.refs = refs
		this.version = toArrayBuffer(version)
	}

	read() {
		if (!this.hasBeenWritten && !this.hasBeenCreated) {
			this.hasBeenRead = true
		}
		if (this.hasBeenCreated || this.hasBeenWritten || this.version != null) {
			return this.readOnlyData
		}

		throw new TransactionRetryNeeded(`Object ${binaryToHex(this.id)} not present in cache`)
	}

	write(value, refs) {
		value = toArrayBuffer(value)
		checkRefs(refs)
		if (!this.hasBeenCreated) {
			this.hasBeenWritten = true
		}
		this.data.value = value
		this.data.refs = refs
	}

	create(value, refs) {
		if (value instanceof ArrayBuffer != true) {
			throw new TypeError("values should be array buffers : " + value)
		}
		checkRefs(refs)
		this.hasBeenCreated = true
		this.data.value = value
		this.data.refs = refs
	}

	clone() {
		return new ObjectCacheEntry(this.id).copyFrom(this)
	}

	copyFrom(otherEntry) {
		this.version = otherEntry.version
		this.data.value = otherEntry.data.value
		this.data.refs = otherEntry.data.refs
		this.hasBeenRead = otherEntry.hasBeenRead
		this.hasBeenWritten = otherEntry.hasBeenWritten
		this.hasBeenCreated = otherEntry.hasBeenCreated
		return this
	}

	toAction(initialVersion) {
		const result = {
			VarId: this.id.buffer,
		}
		const refMessages = this.data.refs ? this.data.refs.map((ref) => ref.toMessage()) : []

		if (this.hasBeenRead && !this.hasBeenWritten) {
			result.Read = {Version: this.version || initialVersion}
		} else if (this.hasBeenWritten && !this.hasBeenRead) {
			result.Write = {Value: this.data.value, References: refMessages}
		} else if (this.hasBeenWritten && this.hasBeenRead) {
			result.ReadWrite = {Version: this.version, Value: this.data.value, References: refMessages}
		} else if (this.hasBeenCreated) {
			result.Create = {Value: this.data.value, References: refMessages}
		} else {
			throw new Error(`No read or write has occurred on object ${this.id}, cannot form an action.`)
		}
		return result
	}
}

class CopyCache {
	constructor(parentCache) {
		this.parentCache = parentCache
		this.objects = new Map()
	}

	get(id) {
		const hashable = binaryToHex(id)
		if (!this.objects.has(hashable)) {
			this.objects.set(hashable, this.parentCache.get(id).clone())
		}
		return this.objects.get(hashable)
	}

	promote(finalTxnId) {
		for (let [, entry] of this.objects) {
			const parentEntry = this.parentCache.get(entry.id)
			if (finalTxnId) {
				// if we are given a transaction id, then this promotion should be treated like a cache update from the server.
				if (entry.hasBeenCreated || entry.hasBeenWritten) {
					parentEntry.update(finalTxnId, entry.data.value, entry.data.refs)
				}
			} else {
				// otherwise, it's a nested transaction completing, so we do a full copy into the parent.
				parentEntry.copyFrom(entry)
			}
		}
	}

	// Returns an array of all the actions that have occurred on this cache.
	getActions(namespace) {
		const actions = []
		// the version to ask for if we don't currently have any data in the cache for an object.
		const initialVersion = Uint64.from(0, 0, 0, 0, 0, 0, 0, 0).concat(namespace)

		for (let [,cacheEntry] of this.objects) {
			if (cacheEntry.hasBeenRead || cacheEntry.hasBeenWritten || cacheEntry.hasBeenCreated) {
				actions.push(cacheEntry.toAction(initialVersion))
			}
		}

		return actions
	}

	getTemporaryView() {
		return new CopyCache(this)
	}
}

const {binaryToHex} = require('./utils')

/**
 * A Ref represents a pointer to an object in the database.
 * Each Ref also carries with it some capabilities that determine
 * which of the actions `read` and `write` can be done with that reference.
 *
 * You can get a Ref either by looking at the roots of the transaction,
 * creating a new object or reading it from an objects references with
 * {@link Transaction#read}.
 */
class Ref {
	/** @private */
	constructor(varId, read, write) {
		if (varId instanceof Uint8Array == false) {
			throw new TypeError("var id must be a uint8 array")
		}

		/**
		 * The goshawkdb id of the object this reference refers to.
		 * @private
		 */
		this.varId = varId

		/**
		 * Whether this reference can be used to read the object.
		 * @type {boolean}
		 */
		this.read = read
		/**
		 * Whether this reference can be used to write the object.
		 * @type {boolean}
		 */
		this.write = write
	}

	/** @private */
	static fromCapRef(capability, varId) {
		return new Ref(varId, capability.Read, capability.Write)
	}

	/** @private */
	static fromMessage(msg) {
		return Ref.fromCapRef(msg.Capability, msg.VarId)
	}

	/**
	 * Checks to see if this reference and the other reference
	 * refer to the same object in the database.
	 * @param {Ref} otherRef
	 * @returns {boolean} true if the other reference points to the same object, false otherwise.
	 */
	sameReferent(otherRef) {
		return binaryToHex(this.varId) === binaryToHex(otherRef.varId)
	}

	/**
	 * @returns {Ref} a new reference the same as this one, but that cannot be used to read.
	 */
	denyRead() {
		return new Ref(this.varId, false, this.write)
	}

	/**
	 * @returns {Ref} a new reference the same as this one, but that cannot be used to write.
	 */
	denyWrite() {
		return new Ref(this.varId, this.read, false)
	}

	/** @returns {string} a representation of this reference.  String representations are for debug only and are not considered part of the public API. */
	toString() {
		return `{Ref ${binaryToHex(this.varId)} ${this.read ? 'r' : '-'}${this.write ? 'w' : '-'}}`
	}

	/** @private */
	toMessage() {
		return {VarId: this.varId.buffer, Capability: {Read: this.read, Write: this.write}}
	}
}

module.exports = Ref

const Ref = require('./ref')
const {TransactionRetryNeeded, CapabilityDenied} = require('./errors')
const {toArrayBuffer} = require('./utils')

/**
 * A transaction represents an attempt to make a modification to the database.
 *
 * The code associated with it may be required to run multiple times before it
 * successfully completes.  Care must be taken to make sure this will not
 * break the client environment.
 *
 * Transactions are acquired by calling {@link Connection#transact}.
 */
class Transaction {

	/** @private */
	constructor(connection, txnFn, onSuccess, onFail, parentCache) {
		/** @private */
		this.onSuccess = onSuccess;

		/** @private */
		this.onFail = onFail;

		/** @private */
		this.shouldRetry = false

		/**
		 * The roots that this client has access to.
		 * @type {{string: Ref}}
		 */
		this.roots = connection.roots

		/** @private */
		this.fn = txnFn

		/** @private */
		this.connection = connection

		/** @private */
		this.parentCache = parentCache

		/** @private */
		this.cache = parentCache.getTemporaryView()
	}

	/**
	 * Reads the value and references from an object pointed to by a Ref.
	 * @param {Ref} ref a reference to the object to read from.
	 * @returns {{value:ArrayBuffer, refs:Ref[]}}
	 * @throws {CapabilityDenied} if ref does not have read capability.
	 * @throws {TransactionRetryNeeded} if the object is not in cache. Do not catch this without rethrowing it.
	 */
	read(ref) {
		if (ref instanceof Ref == false) {
			throw new TypeError(`Can only read a reference; you tried to read from ${String(ref)}`)
		}
		if (!ref.read) {
			throw new CapabilityDenied(`Unable to read using reference ${ref.toString()}, as it doesn't allow reads.`)
		}
		const id = ref.varId
		const cacheEntry = this.cache.get(id)
		return cacheEntry.read()
	}

	/**
	 * Changes the value an dreferences of an object pointed to by a Ref.
	 * @param {Ref} ref a reference to the object to be written.
	 * @param {ArrayBuffer|Buffer|TypedArray} value the new value to be stored in the object.
	 * @param {Ref[]} refs the references from this object to other objects.
	 */
	write(ref, value, refs) {
		if (ref instanceof Ref == false) {
			throw new TypeError(`Can only write with a reference; you tried to write to ${String(ref)}.`)
		}
		if (!ref.write) {
			throw new CapabilityDenied(`Unable to write using reference ${ref.toString()}, as it doesn't allow writes.`)
		}
		value = toArrayBuffer(value)
		const id = ref.varId
		const cacheEntry = this.cache.get(id)
		cacheEntry.write(value, refs)
	}

	/**
	 * Creates a new object and returns the reference to it.
	 * @param {ArrayBuffer|Buffer|TypedArray} value the value that the new object will be created with.
	 * @param {Ref[]} refs the references that the new object will be created with.  This will default to the empty array.
	 * @returns {Ref} a reference to the newly created object.
	 */
	create(value, refs = []) {
		value = toArrayBuffer(value)
		const newId = this.connection.getNewObjectId()
		const cacheEntry = this.cache.get(newId)
		cacheEntry.create(value, refs)
		return new Ref(new Uint8Array(newId), true, true)
	}

	/**
	 * Stops the current transaction, and waits for any of the values that have been
	 * read to change before rerunning.  No further transactions will be processed while
	 * a transaction is waiting.
	 *
	 * Internally, this method throws a TransactionRetryNeeded error.  If you catch it
	 * and do not rethrow it, you will stop the retry behaviour from working.
	 *
	 * @throws {TransactionRetryNeeded}
	 */
	retry() {
		this.shouldRetry = true
		throw new TransactionRetryNeeded("Transaction code called retry.")
	}

	/**
	 * Runs a nested transaction inside this transaction.
	 *
	 * If a nested transaction fails, its modifications will not be seen by the parent transaction.
	 *
	 * @param {function} fn the transaction function.  This function may be run multiple times and should rethrow any TransactionRetryNeeded exceptions.
	 * @returns {Promise<*, Error>} a promise that resolves to the result of the transaction function once the transaction submits or an error if it cannot.
	 */
	transact(fn) {
		if (fn instanceof Function === false) {
			throw new TypeError("Transaction argument must be a function.")
		}
		const nestedTransaction = new Transaction(this.connection, fn, this.onSuccess, this.onFail, this.cache)
		this.connection.currentTransaction = nestedTransaction
		let resultPromise = undefined
		try {
			resultPromise = Promise.resolve(fn(nestedTransaction))
		} catch (e) {
			if (e instanceof TransactionRetryNeeded) {
				this.shouldRetry = true
			}
			this.connection.currentTransaction = this
			throw e
		}

		return resultPromise
			.then((result) => {
				this.connection.currentTransaction = this
				nestedTransaction.promoteCache(undefined)
				return result
			})
	}

	// private API

	/** @private
	 * Prepares this transaction to be run again.*/
	reset() {
		this.cache = this.parentCache.getTemporaryView()
		this.shouldRetry = false
	}

	/** @private
	 * This transaction has completed successfully, notify the parent.*/
	promoteCache(finalTxnId) {
		this.cache.promote(finalTxnId)
	}

	/** @private */
	toMessage(txnId) {
		const actions = this.cache.getActions(this.connection.namespace)
		return {
			ClientTxnSubmission: {
				Id: txnId,
				Retry: this.shouldRetry,
				Actions: actions
			}
		}
	}
}

module.exports = Transaction

const {binaryToHex, toArrayBuffer} = require('./utils')

/**
 * A representation of a Uint64, since otherwise javascript can't do them.
 */
class Uint64 {
	/**
	 * Makes a new Uint64 from a Uint8Array
	 * @param {Uint8Array} uintArray an array of bytes to be used to represent this 64 bit integer.
	 */
	constructor(uintArray = new Uint8Array(8)) {
		if (uintArray instanceof Uint8Array === false) {
			throw new TypeError("Uint64 source must be a Uint8Array, Uint64.from(bytes), Uint64.fromTypedArray, Uint64.fromArrayBuffer might suit your needs better.")
		}
		/**
		 * @private
		 * @type {Uint8Array}
		 */
		this.data = uintArray

		/**
		 * An arraybuffer representation of this value.
		 * @type {ArrayBuffer}
		 */
		this.buffer = this.data.buffer
	}

	/**
	 * Creates a Uint64 from bytes
	 * @param {number[]} bytes
	 * @returns {Uint64}
	 */
	static from(...bytes) {
		const result = new Uint64()
		result.set(...bytes)
		return result
	}

	/**
	 * Creates a Uint64 from the first 8 bytes of one of the binary forms.
	 * @param {ArrayBuffer|Buffer|TypedArray} binary
	 * @returns {Uint64}
	 */
	static fromBinary(binary) {
		return Uint64.fromArrayBuffer(toArrayBuffer(binary))
	}

	/**
	 * Creates a Uint64 from an array buffer. Potentially with a byte offset.
	 * Only the first 8 bytes will be taken.
	 * @param {ArrayBuffer} arrayBuffer
	 * @param {number} byteOffset the starting position in the array buffer. Defaults to 0.
	 * @returns {Uint64}
	 */
	static fromArrayBuffer(arrayBuffer, byteOffset = 0) {
		return new Uint64(new Uint8Array(arrayBuffer.slice(byteOffset, byteOffset + 8)))
	}

	/**
	 * Modifies this Uint64 to represent the succeeding integer.  If
	 * this represents the largest integer the Uint64 can represent, it will wrap to 0.
	 * @returns {Uint64} this, modified Uint64.
	 */
	inc() {
		for (let idx = this.data.length - 1; idx >= 0; --idx) {
			this.data[idx] += 1
			if (this.data[idx] != 0) {
				break
			}
		}
		return this
	}

	/**
	 * @returns {Uint64} a copy of this Uint64.
	 */
	clone() {
		const dst = new ArrayBuffer(this.data.byteLength)
		const uintArray = new Uint8Array(dst)
		uintArray.set(this.data)
		return new Uint64(uintArray)
	}

	/**
	 * Set the last last bytes.length bytes.
	 * @param {number[]} bytes the bytes to set.
	 */
	set(...bytes) {
		if (bytes[0] instanceof Uint64) {
			this.data.set(bytes[0].data, 0)
		} else {
			for (let i = 0; i < bytes.length; ++i) {
				this.data[this.data.length - bytes.length + i] = bytes[i]
			}
		}
	}

	/**
	 * Returns an array buffer where this Uint64 is the first 8 bytes and
	 * the passed buffer is the subsequent bytes.
	 * @param {ArrayBuffer|Buffer|TypedArray} buffer the subsequent bytes.
	 * @returns {ArrayBuffer}
	 */
	concat(buffer) {
		buffer = toArrayBuffer(buffer)
		const result = new Uint8Array(this.data.length + buffer.byteLength)
		result.set(this.data, 0)
		result.set(new Uint8Array(buffer), this.data.length)
		return result.buffer
	}

	/**
	 * A string representation of this Uint64.  This string representation is for debugging purposes
	 * and does not form part of the public API.
	 */
	toString() {
		return binaryToHex(this.data)
	}
}

module.exports = Uint64

/**
 * @param {ArrayBuffer|Buffer|TypedArray} binary the binary we want to represent in hex.
 * @returns {string} a hexadecimal representation of this binary.
 */
exports.binaryToHex = function binaryToHex(binary) {
	let uintarray = null
	if (binary instanceof Uint8Array) {
		uintarray = binary
	} else {
		uintarray = new Uint8Array(toArrayBuffer(binary))
	}
	return "0x" + Array.from(uintarray).map((x) => ('0' + x.toString(16)).substr(-2)).join("")
}

/**
 * Tries to convert a binary value into an array buffer.
 * @param {ArrayBuffer|Buffer|TypedArray} value the value to convert.
 * @returns {ArrayBuffer}
 */
exports.toArrayBuffer = function toArrayBuffer(value) {
	if (value instanceof ArrayBuffer) {
		return value
	} else if (value instanceof Buffer) {
		return value.buffer.slice(value.offset, value.offset + value.length)
	} else if (value instanceof ArrayBuffer === false && value.buffer && value.buffer instanceof ArrayBuffer) {
		return value.buffer
	}
	throw new TypeError("Unable to convert value to array buffer " + value)
}

/**
 * Runs the provided function, and wraps the output or thrown error in a promise.
 * This is useful for writing code that deals with functions that may be either synchronous or
 * asynchronous.
 * @param {function} fn the function that will be evaluated to populate the promise.
 * @returns {Promise}
 */
exports.asPromise = function asPromise(fn) {
	try {
		return Promise.resolve(fn())
	} catch (e) {
		return Promise.reject(e)
	}
}
